import React from 'react'
import homepic from '../assets/homepic.png'
import Mask from '../assets/mask-image.png'; // Replace with the path to your wave mask image
function Home() {

    const hometext = {
        fontFamily: 'ITC Franklin Gothic LT', 
        fontSize: '55px', 
        marginTop: '180px',
        marginLeft:'150px',
        whiteSpace: 'pre-line', // Allow line breaks
        fontWeight:'bold'
    };
    const homepicture = {
        width: '900px',
        height: '500px',
        WebkitMaskImage: `url(${Mask})`, // WebKit browsers (Chrome, Safari)
        maskImage: `url(${Mask})`, // Standard property
        maskSize: 'cover', // Adjust as needed
        marginLeft:'750px',
        marginTop:'-200px',
        border: '15px solid #63821b',

      };
      const hometext2 = {
        fontSize: '50px',
        fontColor:'white',
        backgroundColor: '#546a36', // Background color
        padding: '20px', // Adjust padding as needed
        borderRadius: '50% 50% 0 0 / 30%', // Curved shape
        marginBottom: '-80px', // Adjust the top margin
        marginLeft: '0px', // Adjust the left margin
      };
  return (
    <div>
        <div style = {hometext}>Changing the Face of {'\n'}Irish Food Education</div>
        <div><img src={homepic} alt="homepic" style={homepicture} /></div>
        <div>
            <div style = {hometext2}>By the time our children are adults, they won't know how to cook. We want to change that</div>
        </div>

    </div>

  )
}

export default Home
